Apparently, the LEA, MEA, and HEA alloys have distinctively different strain hardening behaviors than either Cu or 304SS. The strain hardening behaviors of the LEA and MEA can be divided into three different stages. The arrows indicate changes in the deformation stages of the LEA. The first stage is characterized by a continuous decrease in strain hardening rate in the initial deformation. Although the first stage of the LEA and MEA strain hardening behaviors ends at 77 and 102MPa of (σ-σ

                           0
                        ), respectively, these two strength values represent the same true strain (~4%) for each of them. The additional alloying of Cr and Fe in the MEA increased solid solution hardening (SSH) and also enhanced dislocation multiplication.
